(2, 1, '2018-01-24 06:42:27', '2018-01-24 06:42:27', 'This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:\n\n<blockquote>Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my website. I live in Los Angeles, have a great dog named Jack, and I like pi&#241;a coladas. (And gettin\' caught in the rain.)</blockquote>\n\n...or something like this:\n\n<blockquote>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</blockquote>\n\nAs a new WordPress user, you should go to <a href=\"http://theviralads.com/wp-admin/\">your dashboard</a> to delete this page and create new pages for your content. Have fun!', 'Sample Page', '', 'publish', 'closed', 'open', '', 'sample-page', '', '', '2018-01-24 06:42:27', '2018-01-24 06:42:27', '', 0, 'http://theviralads.com/?page_id=2', 0, 'page', '', 0),
(98, 1, '2018-03-23 09:00:42', '2018-03-23 09:00:42', 'All Out released a new ad campaign directed by Shoojit Sircar. This ad showcases the importance of #StandByToughMoms by carrying out conversations around the need to strengthen the affiance and sureness in a mother’s decisions. It also tells us about the importance of supporting mothers who make tough parenting decisions.\r\n\r\nIn this ad campaign, Shoojit captured the reality of a mother’s life by showing the challenges which they often face. It\'s time after all, each and every mother always tries to do what is best for their child and we must stand by her in everything that she does without judgments or any doubt.  It’s the right time. Let’s come together and stand by mothers and believed in each and every decision.\r\n\r\n[embed]https://youtu.be/ppPzROPWyKU[/embed]\r\n\r\nThe brand rolled out the ad by showing a big family having dinner and facing a situation which raises parenting questions of a mother when she scold her son on stealing ten rupee note from her wallet without asking her permission. Everyone criticizes mom’s decision of scolding her son but the oldest family member (may be of a boy) grandfather takes a stand. He says whatever she is doing today is absolutely right. When you see a mother being tough, stand by her because when you stand by a tough mom then you help her protect the next generation.\r\n\r\nThe ad beautifully points out towards the #standbytoughmoms by the brand. This will increase awareness and garner support for parents. Everyday parents have to make tough decisions for the betterment of their children’s future. We can completely relate to the situation shown in our day to day life. We must initiate conversations within families for raising the happy and healthy children.\r\n\r\nThanks to All OUT – It’s Good To Be Tough', 'An All Out Ad Stand By Mom’s Tough Parenting Decisions', '', 'inherit', 'closed', 'closed', '', '69-revision-v1', '', '', '2018-03-23 09:00:42', '2018-03-23 09:00:42', '', 69, 'http://theviralads.com/2018/03/23/69-revision-v1/', 0, 'revision', '', 0),
(73, 1, '2018-03-08 10:24:38', '2018-03-08 10:24:38', 'Prega News has just launched a campaign <a href=\"https://brandequity.economictimes.indiatimes.com/tag/%23yoursecondhome\">#YourSecondHome</a> targeting to corporate sector on the occasion of Women’s Day. The brand rolled out campaign by focusing on ‘Your Second Home’ targeting offices. Brand had given the tribute to all the mothers who want to continue work during their pregnancies. According to the companies, since these women end up spending the maximum time in offices, therefore, the duty of making them comfortable is the concern of their workplaces.\r\n\r\n[embed]https://youtu.be/Vwf3PUdtPrI[/embed]\r\n\r\nPrega news takes the initiative to support women suffering from postpartum depression. Postpartum Depression (PPD) is a condition that is associated with childbirth. Studies suggest that postpartum depression can start any time during the first year of having a baby. Postpartum Depression is a harsh reality of present scenario. We should extend our support to all the mothers who are going with this phase and help them to create a home, outside their home <a href=\"https://brandequity.economictimes.indiatimes.com/tag/%23yoursecondhome\">#YourSecondHome</a>.\r\n\r\nThanks to <a href=\"https://twitter.com/PregaNews\">@PregaNews</a> for taking this step towards the mothers who is struggling from Postpartum Depression. It is necessary for everyone around mothers to be supportive and helpful in times of need.\r\n\r\nLet’s join hands together on this Women’s Day for the cause of women suffering from Postpartum Depression.', 'Prega News: Making The World #YOURSECONDHOME', '', 'publish', 'open', 'open', '', 'prega-news-making-the-world-yoursecondhome', '', '', '2018-03-25 18:02:21', '2018-03-25 18:02:21', '', 0, 'http://theviralads.com/?p=73', 0, 'post', '', 0),
(74, 1, '2018-03-08 10:13:33', '2018-03-08 10:13:33', 'Prega news takes the initiative to support women suffering from postpartum depression on Womens Day.', 'Making The World #YOURSECONDHOME', 'Prega News: Making The World #YOURSECONDHOME', 'inherit', 'open', 'closed', '', 'your-second-home-join-hands-for-the-cause-of-women-suffering-from-postpartum-depression', '', '', '2018-03-08 10:18:35', '2018-03-08 10:18:35', '', 73, 'http://theviralads.com/wp-content/uploads/2018/03/Your-second-home-Join-hands-for-the-cause-of-women-suffering-from-Postpartum-Depression.mp4', 0, 'attachment', 'video/mp4', 0),
(72, 1, '2018-03-08 08:01:47', '2018-03-08 08:01:47', 'All Out released a new ad campaign directed by Shoojit Sircar. This ad showcases the importance of #StandByToughMoms by carrying out conversations around the need to strengthen the affiance and sureness in a mother’s decisions. It also tells us about the importance of supporting mothers who make tough parenting decisions.\r\n\r\nIn this ad campaign, Shoojit captured the reality of a mother’s life by showing the challenges which they often face. It\'s time after all, each and every mother always tries to do what is best for their child and we must stand by her in everything that she does without judgments or any doubt.  It’s the right time. Let’s come together and stand by mothers and believed in each and every decision.\r\n\r\n[video width=\"1280\" height=\"720\" mp4=\"http://theviralads.com/wp-content/uploads/2018/03/All-Out-StandByToughMoms.mp4\"][/video]\r\n\r\nThe brand rolled out the ad by showing a big family having dinner and facing a situation which raises parenting questions of a mother when she scold her son on stealing ten rupee note from her wallet without asking her permission. Everyone criticizes mom’s decision of scolding her son but the oldest family member (may be of a boy) grandfather takes a stand. He says whatever she is doing today is absolutely right. When you see a mother being tough, stand by her because when you stand by a tough mom then you help her protect the next generation.\r\n\r\nThe ad beautifully points out towards the #standbytoughmoms by the brand. This will increase awareness and garner support for parents. Everyday parents have to make tough decisions for the betterment of their children’s future. We can completely relate to the situation shown in our day to day life. We must initiate conversations within families for raising the happy and healthy children.\r\n\r\nThanks to All OUT – It’s Good To Be Tough', 'An All Out Ad Stand By Mom’s Tough Parenting Decisions', '', 'inherit', 'closed', 'closed', '', '69-revision-v1', '', '', '2018-03-08 08:01:47', '2018-03-08 08:01:47', '', 69, 'http://theviralads.com/2018/03/08/69-revision-v1/', 0, 'revision', '', 0),
