(100, 1, '2018-03-25 18:02:21', '2018-03-25 18:02:21', 'Prega News has just launched a campaign <a href=\"https://brandequity.economictimes.indiatimes.com/tag/%23yoursecondhome\">#YourSecondHome</a> targeting to corporate sector on the occasion of Women’s Day. The brand rolled out campaign by focusing on ‘Your Second Home’ targeting offices. Brand had given the tribute to all the mothers who want to continue work during their pregnancies. According to the companies, since these women end up spending the maximum time in offices, therefore, the duty of making them comfortable is the concern of their workplaces.\r\n\r\n[embed]https://youtu.be/Vwf3PUdtPrI[/embed]\r\n\r\nPrega news takes the initiative to support women suffering from postpartum depression. Postpartum Depression (PPD) is a condition that is associated with childbirth. Studies suggest that postpartum depression can start any time during the first year of having a baby. Postpartum Depression is a harsh reality of present scenario. We should extend our support to all the mothers who are going with this phase and help them to create a home, outside their home <a href=\"https://brandequity.economictimes.indiatimes.com/tag/%23yoursecondhome\">#YourSecondHome</a>.\r\n\r\nThanks to <a href=\"https://twitter.com/PregaNews\">@PregaNews</a> for taking this step towards the mothers who is struggling from Postpartum Depression. It is necessary for everyone around mothers to be supportive and helpful in times of need.\r\n\r\nLet’s join hands together on this Women’s Day for the cause of women suffering from Postpartum Depression.', 'Prega News: Making The World #YOURSECONDHOME', '', 'inherit', 'closed', 'closed', '', '73-revision-v1', '', '', '2018-03-25 18:02:21', '2018-03-25 18:02:21', '', 73, 'http://theviralads.com/2018/03/25/73-revision-v1/', 0, 'revision', '', 0),
