(78, 1, '2018-03-09 15:57:01', '2018-03-09 15:57:01', 'Lenovo India has launched a <a href=\"https://www.trendsmap.com/topic/%23GiftThemDreams\">#GiftThemDreams</a> campaign urging parents that your kids and their dreams deserve a chance, to follow them. Supports your kids to fulfill their dreams and see them take on the world. This childish phase could be her dream too, right? And if we think her dream is just a childish phase, won’t you fail as parents? If the child decides what they have to become then any hurdle or problems that come on their way can’t stop them.\r\n\r\n[embed]https://youtu.be/9uQiyiq0q40[/embed]\r\n\r\nGift them dreams to breaks the stereotype and shows even low-class families are motivating and supporting their girls to do something big. There\'s a hidden qualities in every little one which constantly push them to dream big. As parents you should give your kids a chance to realize their passions.\r\n\r\nSince childhood, we have grown up with hopes and dreams for achieving our goals in the guidance of our parents. Based upon our livelihood and values, a main part of our childhood, Lenovo products, too has come a long way with us. To honor Lenovo India sustained efforts to not only deliver quality, but become a part of innumerable memories and success stories in our lives.\r\n\r\nLenovo is not only just a brand but they are also very passionate to meets your need in every way.', '#GiftThemDreams : Let Your Child Reach The Stars', '', 'publish', 'open', 'open', '', 'giftthemdreams-let-your-child-reach-the-stars', '', '', '2018-03-25 18:03:35', '2018-03-25 18:03:35', '', 0, 'http://theviralads.com/?p=78', 0, 'post', '', 0),
